import Naverbar from "./page/Naverbar"
import Header from "./page/Header"
import Homepage from "./page/Homepage"
import Footer from "./page/Footer";





function App() {
  return (
    <div className="App">
   
              <Naverbar />
              <Header />
              <Homepage />
              <Footer />
            
    </div>
  );
}

export default App;
